import Tabela from '../layout/Tabela'
import styles from './Despesas.module.css'
function Despesas({dividas,setDividas}){
    return(
        <div className={styles.conteudo_desp}>
            <h1>Despesas</h1>
            
            {typeof options !== 'undefined' && options.map((categoria) =>{
                return <Tabela dividas={dividas} setDividas={setDividas} />
                }
                )}
                <option value={categoria.id} key={categoria.id}>{categoria.name}</option>


        </div>

    )
}

export default Despesas
